import React from "react";

function Collections () {
    return (
        <>
        <div className="components">
            <img src="./images/Aduke.jpg" alt="Aduke" />
            <img src="./images/DamDam.jpeg" />
            <img src="./images/Eve.jpg" />
            <img src="./images/Funmilayo.jpg" />
            <img src="./images/Olufayo.jpg" />
        </div>
        </>
    )
}

export default Collections;
